--
-- Name: create_notification(uuid, uuid, text, text, text, jsonb); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_notification(p_user_id uuid, p_actor_id uuid, p_type text, p_message text, p_link text, p_metadata jsonb) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    -- Ensure we don't send a notification to the person who performed the action
    IF p_user_id <> p_actor_id THEN
        INSERT INTO public.notifications (user_id, actor_id, type, message, link, metadata)
        VALUES (p_user_id, p_actor_id, p_type, p_message, p_link, p_metadata);
    END IF;
END;
$$;


ALTER FUNCTION public.create_notification(p_user_id uuid, p_actor_id uuid, p_type text, p_message text, p_link text, p_metadata jsonb) OWNER TO postgres;

--
-- Name: create_notification_on_order_update(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_notification_on_order_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    notification_message TEXT;
    item_name TEXT;
BEGIN
    -- Get the item name from the listings table
    SELECT l.item_name INTO item_name
    FROM public.listings l
    WHERE l.id = NEW.listing_id;

    -- Create a descriptive notification message
    notification_message := 'Your order for "' || item_name || '" has been updated to: ' || REPLACE(INITCAP(NEW.status), '_', ' ');

    -- Insert the new notification
    INSERT INTO public.notifications (user_id, actor_id, type, message, link, metadata)
    VALUES (
        NEW.buyer_id,
        NEW.seller_id,
        'order_update',
        notification_message,
        '/orders',
        jsonb_build_object('itemImage', (SELECT image_urls[1] FROM public.listings WHERE id = NEW.listing_id))
    );

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.create_notification_on_order_update() OWNER TO postgres;

