-- Name: delete_barter_request(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.delete_barter_request(request_id integer) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  DELETE FROM public."BarterRequest"
  WHERE id = request_id AND (
    (SELECT auth.uid()) = requester_id OR (SELECT auth.uid()) = listing_owner_id
  );
END;
$$;


