--

CREATE FUNCTION public.get_foryou_recommendations(user_id_param uuid) RETURNS TABLE(id bigint, created_at timestamp with time zone, item_name text, description text, price double precision, price_type text, categories text[], is_new boolean, deal_method text, image_urls text[], user_id uuid, view_count bigint, click_count bigint, status text)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    l.id,
    l.created_at,
    l.item_name,
    l.description,
    CAST(l.price AS double precision),
    l.price_type,
    l.categories,
    l.is_new,
    l.deal_method,
    l.image_urls,
    l.user_id,
    -- FIX 1: Cast view_count to bigint
    CAST(l.view_count AS bigint),
    -- FIX 2: Cast click_count to bigint
    CAST(l.click_count AS bigint),
    l.status
  FROM
    listings AS l
  WHERE
    l.user_id <> user_id_param
    AND l.id NOT IN (
      SELECT favorites.listing_id FROM favorites WHERE favorites.user_id = user_id_param
    )
    AND l.categories && (
      SELECT array_agg(DISTINCT c)
      FROM (
        SELECT unnest(listings.categories) AS c
        FROM listings
        WHERE listings.id IN (
          SELECT favorites.listing_id FROM favorites WHERE favorites.user_id = user_id_param
        )
      ) AS user_categories
    )
  ORDER BY
    l.created_at DESC
  LIMIT 20;
END;
$$;


ALTER FUNCTION public.get_foryou_recommendations(user_id_param uuid) OWNER TO postgres;

