-- Name: get_nearby_listings(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_nearby_listings(p_user_id uuid) RETURNS SETOF public.listings
    LANGUAGE plpgsql
    AS $$
DECLARE
    user_location GEOGRAPHY;
BEGIN
    SELECT location INTO user_location FROM users WHERE id = p_user_id;

    IF user_location IS NULL THEN
        -- Return an empty set if the user's location is not available
        RETURN;
    END IF;

    RETURN QUERY
    SELECT *
    FROM listings
    WHERE ST_DWithin(location, user_location, 20000) -- 20km radius
    AND user_id != p_user_id
    ORDER BY ST_Distance(location, user_location)
    LIMIT 50;
END;
$$;


