--
-- Name: get_recommendations_based_on_searches(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_recommendations_based_on_searches(user_id_param uuid) RETURNS TABLE(id bigint, created_at timestamp with time zone, item_name text, description text, price double precision, price_type text, categories text[], is_new boolean, deal_method text, image_urls text[], user_id uuid, view_count bigint, click_count bigint, status text)
    LANGUAGE plpgsql
    AS $$
DECLARE
  search_terms text[];
BEGIN
  -- Get the last 5 distinct search terms for the user
  SELECT array_agg(DISTINCT query) INTO search_terms
  FROM (
    SELECT query FROM user_searches
    WHERE user_searches.user_id = user_id_param
    ORDER BY created_at DESC
    LIMIT 5
  ) as recent_searches;

  -- If there are no search terms, return nothing
  IF search_terms IS NULL THEN
    RETURN;
  END IF;

  RETURN QUERY
  SELECT
    l.id,
    l.created_at,
    l.item_name,
    l.description,
    CAST(l.price AS double precision),
    l.price_type,
    l.categories,
    l.is_new,
    l.deal_method,
    l.image_urls,
    l.user_id,
    CAST(l.view_count AS bigint),
    CAST(l.click_count AS bigint),
    l.status
  FROM
    listings AS l
  WHERE
    l.user_id <> user_id_param
    AND l.status = 'active'
    -- Match item name against any of the search terms
    AND l.item_name ILIKE ANY(SELECT '%' || unnest(search_terms) || '%')
  ORDER BY
    l.created_at DESC
  LIMIT 20;
END;
$$;


ALTER FUNCTION public.get_recommendations_based_on_searches(user_id_param uuid) OWNER TO postgres;

--
-- Name: get_recommended_by_category_interaction(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_recommended_by_category_interaction(p_user_id uuid) RETURNS SETOF public.listings
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    WITH user_interactions AS (
        -- Combine liked, viewed, and searched categories
        SELECT unnest(categories) AS category
        FROM listings
        WHERE id IN (SELECT listing_id FROM favorites WHERE user_id = p_user_id)
        UNION
        SELECT unnest(categories) AS category
        FROM listings
        WHERE id IN (SELECT listing_id FROM listing_views WHERE user_id = p_user_id)
    )
    , top_categories AS (
        SELECT category
        FROM user_interactions
        GROUP BY category
        ORDER BY count(*) DESC
        LIMIT 5
    )
    SELECT l.*
    FROM listings l
    WHERE EXISTS (
        SELECT 1
        FROM top_categories tc
        WHERE l.categories && ARRAY[tc.category]
    )
    AND l.user_id != p_user_id
    ORDER BY l.created_at DESC
    LIMIT 50;
END;
$$;


ALTER FUNCTION public.get_recommended_by_category_interaction(p_user_id uuid) OWNER TO postgres;

