CREATE FUNCTION public.get_unread_conversation_count(p_user_id uuid) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    unread_count INT;
BEGIN
    SELECT COUNT(*)
    INTO unread_count
    FROM public.conversations
    WHERE
        participant_ids @> ARRAY[p_user_id]::UUID[]
        AND is_archived = FALSE
        AND (participant_unread_counts ->> p_user_id::TEXT)::INT > 0;

    RETURN unread_count;
END;
$$;


