--
-- Name: handle_listing_view(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.handle_listing_view(listing_id_param integer) RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  viewer_id UUID := auth.uid();
  listing_owner_id UUID;
BEGIN
  -- Get the owner of the listing
  SELECT user_id INTO listing_owner_id FROM public.listings WHERE id = listing_id_param;

  -- Do not do anything if the viewer is the owner
  IF viewer_id = listing_owner_id THEN
    RETURN;
  END IF;

  -- Insert a new view record if it doesn't exist
  INSERT INTO public.listing_views (listing_id, user_id)
  VALUES (listing_id_param, viewer_id)
  ON CONFLICT (listing_id, user_id) DO NOTHING;

  -- If the insert was successful (i.e., it was a new view), increment the view_count
  IF FOUND THEN
    UPDATE public.listings
    SET view_count = view_count + 1
    WHERE id = listing_id_param;
  END IF;
END
$$;


ALTER FUNCTION public.handle_listing_view(listing_id_param integer) OWNER TO postgres;

