--
-- Name: increment_unread_count(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.increment_unread_count() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  recipient_id uuid;
  conversation_row conversations;
BEGIN
  -- Find the recipient's ID by looking at the conversation's participant_ids
  -- and excluding the person who sent the message (the NEW.sender_id)
  SELECT * INTO conversation_row FROM public.conversations WHERE id = NEW.conversation_id;
  
  recipient_id := (
    SELECT id FROM unnest(conversation_row.participant_ids) AS id
    WHERE id <> NEW.sender_id
    LIMIT 1
  );

  -- If a recipient is found, update their unread count in the JSONB column
  IF recipient_id IS NOT NULL THEN
    UPDATE public.conversations
    SET 
      -- Increment the unread count for the specific recipient
      participant_unread_counts = jsonb_set(
        COALESCE(participant_unread_counts, '{}'::jsonb),
        ARRAY[recipient_id::text],
        to_jsonb(COALESCE((participant_unread_counts->>recipient_id::text)::int, 0) + 1)
      ),
      -- Also update the last message preview for real-time updates in the conversation list
      last_message_text = NEW.message_text,
      last_message_at = NEW.created_at
    WHERE id = NEW.conversation_id;
  END IF;

  RETURN NEW;
END;
$$;


ALTER FUNCTION public.increment_unread_count() OWNER TO postgres;

