--
-- Name: log_call_event_to_chat(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.log_call_event_to_chat() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    conversation_id_val int8;
    caller_name text;
    callee_name text;
    message_text_val text;
    duration_in_seconds int;
BEGIN
    -- Find the conversation between the two users
    SELECT id INTO conversation_id_val
    FROM conversations
    WHERE participant_ids @> ARRAY[NEW.caller_id, NEW.callee_id]::uuid[]
    LIMIT 1;

    -- If no conversation exists, do nothing
    IF conversation_id_val IS NULL THEN
        RETURN NEW;
    END IF;

    -- Get caller and callee names
    SELECT "fullName" INTO caller_name FROM public.users WHERE id = NEW.caller_id;
    SELECT "fullName" INTO callee_name FROM public.users WHERE id = NEW.callee_id;

    -- Construct the message based on the new status
    IF NEW.status = 'ended' AND OLD.status = 'answered' THEN
        duration_in_seconds := EXTRACT(EPOCH FROM (NEW.ended_at - NEW.started_at));
        message_text_val := 'Call ended. Duration: ' || to_char(interval '1 second' * duration_in_seconds, 'MI:SS');
    ELSIF NEW.status = 'declined' THEN
        message_text_val := callee_name || ' declined the call.';
    ELSIF NEW.status = 'ended' AND OLD.status = 'dialing' THEN
        message_text_val := callee_name || ' missed a ' || NEW.call_type || ' call from ' || caller_name || '.';
    ELSE
        -- Don't log other status changes to chat
        RETURN NEW;
    END IF;

    -- Insert the system message into the messages table
    INSERT INTO public.messages(conversation_id, sender_id, message_text, message_type)
    VALUES (conversation_id_val, NEW.caller_id, message_text_val, 'system');
    
    -- Also update the conversation's last message
    UPDATE public.conversations
    SET last_message_text = message_text_val,
        last_message_at = now()
    WHERE id = conversation_id_val;

    RETURN NEW;
END;
$$;


ALTER FUNCTION public.log_call_event_to_chat() OWNER TO postgres;

