CREATE FUNCTION public.nearby_listings(user_lat double precision, user_lon double precision) RETURNS TABLE(id bigint, created_at timestamp with time zone, item_name text, description text, price numeric, categories text[], is_new boolean, deal_method text, image_urls text[], user_id uuid)
    LANGUAGE plpgsql
    AS $$
