        l.price,
        l.categories,
        l.is_new,
        l.deal_method,
        l.image_urls,
        l.user_id
    FROM
        listings AS l
    WHERE
        st_dwithin(
            l.location,
            st_point(user_lon, user_lat)::geography,
            50000 -- 50km radius
        )
    ORDER BY
        st_distance(l.location, st_point(user_lon, user_lat)::geography);
END;
$$;


