      l.price,
      l.price_type,
      l.categories,
      l.is_new,
      l.deal_method,
      l.image_urls,
      l.user_id,
      l.view_count,
      l.click_count,
      l.status,
      ST_Distance(
          l.geog_location,
          ST_SetSRID(ST_MakePoint(user_lon, user_lat), 4326)::geography
      )::float AS distance_meters,
      json_build_object(
          'fullName', u."fullName",
          'profilePhotoUrl', u."profilePhotoUrl"
      ) AS "users",
      json_build_object('y', ST_Y(l.geog_location::geometry), 'x', ST_X(l.geog_location::geometry)) AS location
  FROM
      public.listings AS l
  JOIN
      public.users AS u ON l.user_id = u.id
  WHERE l.status = 'active' AND l.geog_location IS NOT NULL
  ORDER BY
      l.geog_location <-> ST_SetSRID(ST_MakePoint(user_lon, user_lat), 4326)::geography;
END;
$$;


