--
-- Name: reset_unread_count(integer, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.reset_unread_count(p_conversation_id integer, p_user_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- This function updates the 'conversations' table.
  UPDATE public.conversations
  SET
    -- It specifically targets the 'participant_unread_counts' JSONB column.
    -- jsonb_set is used to update a value within the JSON object.
    participant_unread_counts = jsonb_set(
      participant_unread_counts,
      -- The path to the key to update (the user's ID).
      ARRAY[p_user_id::text],
      -- The new value to set for that key.
      '0'::jsonb,
      -- This ensures the key is created if it doesn't exist.
      true
    )
  WHERE
    -- It only updates the row for the specific conversation.
    id = p_conversation_id;
END;
$$;


ALTER FUNCTION public.reset_unread_count(p_conversation_id integer, p_user_id uuid) OWNER TO postgres;

--
-- Name: reset_unread_count(bigint, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.reset_unread_count(p_conversation_id bigint, p_user_id uuid) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
  UPDATE public.conversations
  SET participant_unread_counts = jsonb_set(
    COALESCE(participant_unread_counts, '{}'::jsonb),
    ARRAY[p_user_id::text],
    '0'::jsonb
  )
  WHERE id = p_conversation_id AND participant_ids @> ARRAY[p_user_id];
END;
$$;


