--
-- Name: toggle_like(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.toggle_like(listing_id_param integer) RETURNS jsonb
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  viewer_id UUID := auth.uid();
  is_liked BOOLEAN;
  likes_count INT;
BEGIN
  IF viewer_id IS NULL THEN
    RETURN '{"error": "User not authenticated"}'::JSONB;
  END IF;

  -- Check if the user has already liked the listing
  SELECT EXISTS (
    SELECT 1 FROM public.listing_likes
    WHERE listing_id = listing_id_param AND user_id = viewer_id
  ) INTO is_liked;

  IF is_liked THEN
    -- Unlike the listing
    DELETE FROM public.listing_likes
    WHERE listing_id = listing_id_param AND user_id = viewer_id;
  ELSE
    -- Like the listing
    INSERT INTO public.listing_likes (listing_id, user_id)
    VALUES (listing_id_param, viewer_id);
  END IF;

  -- Get the new like count
  SELECT COUNT(*) INTO likes_count
  FROM public.listing_likes
  WHERE listing_id = listing_id_param;

  RETURN jsonb_build_object('is_liked', NOT is_liked, 'likes_count', likes_count);
END
$$;


